import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import BrokerList from './brokerList/BrokerList';
import StockList from './stockList/StockList'; // Импорт stockList

function App() {
    return (
        <Router>
            <div>
                <h1>Биржа Акций</h1>
                <nav>
                    <ul>
                        <li>
                            <Link to="/brokers">Список брокеров</Link>
                        </li>
                        <li>
                            <Link to="/stocks">Список акций</Link>
                        </li>
                    </ul>
                </nav>
                <Routes>
                    <Route path="/brokers" element={<BrokerList />} />
                    <Route path="/stocks" element={<StockList />} />
                    <Route path="/" element={<BrokerList />} /> {/* Начальная страница */}
                </Routes>
            </div>
        </Router>
    );
}

export default App;
